nd\nYancey Counties.\n\n* WHEN...From 6 PM this evening to noon EST Tuesday.\n\n* IMPACTS...The dangerously cold wind chills as low as 19 below zero\ncould cause frostbite on exposed skin in as little as 30 minutes.\nAn extended period of freezing temperatures could cause ruptured\nwater pipes.", "effective": "2026-01-26T10:09:00-05:00", "ends": "2026-01-27T12:00:00-05:00", "event": "Cold Weather Advisory", "eventCode": {"NationalWeatherService": ["CWY"], "SAME": ["NWS"]}, "expires": "2026-01-26T18:00:00-05:00", "geocode": {"SAME": ["037115", "037199", "037121", "037173", "037087", "037099"], "UGC": ["NCZ048", "NCZ049", "NCZ050", "NCZ051", "NCZ052", "NCZ059"]}, "headline": "Cold Weather Advisory issued January 26 at 10:09AM EST until January 27 at 12:00PM EST by NWS Greenville-Spartanburg SC", "id": "urn:oid:2.49.0.1.840.0.92c9407e2d925b1910bbbe8baea5acfff6069ecc.001.3", "instruction": "Dress in layers including a hat, face mask, and gloves if you must\ngo outside.\n\nTo prevent water pipes from freezing, wrap or drain or allow them to\ndrip slowly.\n\nMake frequent checks on older family, friends, and neighbors. Ensure\nportable heaters are used correctly. Do not use generators or grills\ninside.\n\nUse caution while traveling outside. Wear appropriate clothing, a\nhat, and gloves.", "language": "en-US", "messageType": "Update", "onset": "2026-01-26T18:00:00-05:00", "parameters": {"AWIPSidentifier": ["NPWGSP"], "BLOCKCHANNEL": ["EAS", "NWEM", "CMAS"], "NWSheadline": ["EXTREME COLD WARNING REMAINS IN EFFECT FROM 6 PM THIS EVENING TO NOON EST TUESDAY ABOVE 3500 FEET... ...COLD WEATHER ADVISORY REMAINS IN EFFECT FROM 6 PM THIS EVENING TO NOON EST TUESDAY BELOW 3500 FEET"], "VTEC": ["/O.CON.KGSP.CW.Y.0004.260126T2300Z-260127T1700Z/"], "WMOidentifier": ["WWUS72 KGSP 261509"], "eventEndingTime": ["2026-01-27T12:00:00-05:00"], "expiredReferences": ["w-nws.webmaster@noaa.gov,urn:oid:2.49.0.1.840.0.aea4deece6907dc8882e22fe37f04ecdc6f6c6df.001.2,2026-01-26T01:38:00-05:00"]},
